  if (!props.liked) {
    classes += "-o";
  }

  return (
    <Icon
      id="heart-icon"
      className={classes}
      style={{ cursor: "pointer" }}
      onClick={props.onClick}
    >
      {" "}
    </Icon>
  );
};

export default Like;
